import "./style.css"




const root=ReactDOM.createRoot(document.getElementById("root"))


  //navbar component
  function Navbar(){
    return(
      <nav>
        <h1>Perfumy</h1>
        <ul>
          <li>Home |</li>
          <li>Product |</li>
          <li>About |</li>
          <li>Contact |</li>

        </ul>
      </nav>

  )}

  //search components

  function search(){
    return(
      <div className="search">
        <input type="text" placeholder="search"/>       

      </div>
    )
  }

  root.render(
    <div>
      <Navbar></Navbar>
      <search></search>
    </div>


  )
